import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Id = styled.div``;
const H1 = styled.h1``;

const ExercisePresenter = id => {
  ExercisePresenter.propTypes = {
    id: PropTypes.number
  };
  return (
    <Id>
      <>
        <H1>{this}</H1>
      </>
    </Id>
  );
};

export default ExercisePresenter;
